--- !!python/object:whylog.config.parsers.RegexParserDAO
convertions: {1: date}
log_type: filesystem
name: lostdata
primary_key_groups: [1]
regex_str: '^(\d\d\d\d-\d\d-\d\d \d\d:\d\d:\d\d) Data is missing at (.*)\. Loss =
  (.*) GB\. Host name: (.*)$'
--- !!python/object:whylog.config.parsers.RegexParserDAO
convertions: {1: date}
