name: connectionerror
primary_key_groups: [1]
regex_str: '^(\d\d\d\d-\d\d-\d\d \d\d:\d\d:\d\d) Connection error occurred on (.*)\.
  Host name: (.*)$'
--- !!python/object:whylog.config.parsers.RegexParserDAO
convertions: {1: date}
